import React from "react";
import { AiFillEdit } from 'react-icons/ai';
import { AiFillDelete } from 'react-icons/ai';

function  EnfantCard (props) {
return (
<div className="mx-1 my-3 rounded-2xl bg-white">
<div className=" grid grid-cols-2 text-center items-center w-full border-b-2 border-gray-100 border-t-2 my-3 ">
        <button className="bg-[#5560d8] ml-[5%]  w-fit rounded-md font-medium text-center my-2  text-[#191A43] ring-2 ring-gray-100 hover:bg-[#FFFFFF] hover:text-black hover:scale-105 duration-300" title="Modifier">
          < AiFillEdit size={20} className=' text-center text-white cursor-pointer mx-1 my-1  xs:mx-2 xs:my-2 md:mx-3 md:my-3' />
        </button>
        <button className="bg-[#f92912] ml-[75%]  w-fit text-white  rounded-md font-medium text-center my-2  ring-2 ring-[#ED6361] hover:bg-[#5B112B] hover:text-white hover:scale-105 duration-300" title="Supprimer">
          < AiFillDelete size={20} className=' text-center cursor-pointer mx-1 my-1 xs:mx-2 xs:my-2 md:mx-3 md:my-3' />
        </button>
 </div>
    <h1> {props.nom} </h1>
    <h1> {props.prenom} </h1>
    <h1> {props.Sexe} </h1>
    <h1> {props.Age} </h1>
    
</div>
    
)


}

export default EnfantCard;
